import React, { Component } from 'react';
import {
    BrowserRouter as Router,
} from 'react-router-dom';
import RoutedNav from './components/RoutedNav.jsx';
import './App.css';

class App extends Component {
    render() {
        return (
            <div className="App">
                    <div className="mainModal">
                        <Router>
                            <RoutedNav />
                        </Router>
                    </div>
            </div>
        )
    }
}

export default App;
